import Footer from "../../components/Footer/footer"
import styles from './exhDetail.module.css'
 const {artistid} = useParams()
export default function ExhDetail() {
   
    return (
        <div >
            <Header />
            <h1>{artistid}</h1>


         
    
            <Footer/>
        </div>
    )
}
